function dashDate(value) {
  if (!(value instanceof Date)) return;
  var formatObj = {
    y: value.getFullYear(),
    m: value.getMonth() + 1,
    d: value.getDate()
  };
  formatObj.m < 10 ? formatObj.m = '0' + formatObj.m : '';
  formatObj.d < 10 ? formatObj.d = '0' + formatObj.d : '';
  return formatObj.y + ' - ' + formatObj.m + ' - ' + formatObj.d;
}

function dashDateTime(value) {
  if (!(value instanceof Date)) return;
  var date = dashDate(value);
  var h = value.getHours();
  var m = value.getMinutes();
  var s = value.getSeconds();
  h < 10 ? h = '0' + h : '';
  m < 10 ? m = '0' + m : '';
  s < 10 ? s = '0' + s : '';

  return date + ' ' + h + ' : ' + m + ' : ' + s;
}
